  null,\n\t\"notes\": \"<p>When it is consistent with the public protection responsibilities
  of the agency and depending on the nature of the violation, it is the Food and Drug
  Administration's (FDA's) practice to give individuals and firms an opportunity to
  take voluntary and prompt corrective action before it initiates an enforcement action.
  Warning Letters are issued to achieve voluntary compliance and to establish prior
  notice.  The use of Warning Letters and the prior notice policy are based on the
  expectation that most individuals and firms will voluntarily comply with the law.
  \ See <a href=\"http://www.fda.gov/ICECI/ComplianceManuals/RegulatoryProceduresManual/ucm176870.htm\">http://www.fda.gov/ICECI/ComplianceManuals/RegulatoryProceduresManual/uc...</a>
  for additional infomation on Warning Letters.</p>n\",\n\t\"owner_org\": \"3609164c-4c49-4a44-9179-23163027dc0a\",\n\t\"extras\":
